CREATE TABLE `hackathon`.`buisness_users` (`id` INT(11) NOT NULL AUTO_INCREMENT , `fname` VARCHAR(255) NULL DEFAULT NULL , `lname` VARCHAR(255) NULL DEFAULT NULL , `email` VARCHAR(255) NULL DEFAULT NULL , `profile_photo` INT(255) NULL DEFAULT NULL , `created_at` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP , `number` INT(15) NULL DEFAULT NULL , `unique_id` INT(6) NULL DEFAULT NULL , `password` VARCHAR(255) NULL DEFAULT NULL , PRIMARY KEY (`id`)) ENGINE = InnoDB;